import React from "react";
import '../src/index.css';


const Services=()=>{

    return (
        <>
          <div className="my-5">
            <h1 className="text-center">Our Services</h1>
          </div>
          <div className="container-fluid mb-5">
            <div className="row"></div>
          </div>

        </>
    );

}

export default Services;
